import React from "react";
import headerStyles from './header.module.css';
import {BurgerIcon} from '@ya.praktikum/react-developer-burger-ui-components';


class Header extends React.Component {
    render() {
      return (
        <header className={headerStyles.header}>
           {this.props.children}
           <nav>
            <ul className={headerStyles.menu}>  {this.props.children}
         <li className={headerStyles.link}>
           <img src={BurgerIcon} alt="Конструктор"/>
           <h2  className={headerStyles.title}>Конструктор</h2> 
         </li>
         <li>
           <img />
           <h2  className={headerStyles.title}>Лента заказов</h2> 
         </li>
         </ul>
        </nav>
        <img alt="логотип." />
        </header>
      );
    }
}


  
export default Header;
